import React, { useState } from 'react'
import './Calendar.sass'

function Calendar() {
    const [date, setDate] = useState(new Date)

    enum Months {
        January = 'January',
        February = 'February',
        March = 'March',
        April = 'April',
        May = 'May',
        June = 'June',
        July = 'July',
        August = 'August',
        September = 'September',
        October = 'October',
        November = 'November',
        December = 'December'
    }

    const CheckMonth = (month: number): string => {
        switch (month) {
            case 0:
                return Months.January;
                break;
            case 1:
                return Months.February;
                break;
            case 2:
                return Months.March;
                break;
            case 3:
                return Months.April;
                break;
            case 4:
                return Months.May;
                break;
            case 5:
                return Months.June;
                break;
            case 6:
                return Months.July;
                break;
            case 7:
                return Months.August;
                break;
            case 8:
                return Months.September;
                break;
            case 9:
                return Months.October;
                break;
            case 10:
                return Months.November;
                break;
            case 11:
                return Months.December;
                break;
            default:
                return '';
        }
    }
    return (
        <div className='calendar'>
            <p className='calendar-day'>{date.getDate()}</p>
            <p className='calendar-month'>{() => CheckMonth(date.getMonth())}</p>
        </div>
    )
}

export default Calendar
